import React from 'react';
import styled from 'styled-components';

const TrackerContainer = styled.div`
  padding: 2rem;
  text-align: center;
`;

function Tracker() {
  return (
    <TrackerContainer>
      <h2>Tracker Page</h2>
      <p>This page will eventually display real-time bus tracking data (map, etc.).</p>
    </TrackerContainer>
  );
}

export default Tracker;
